import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import GoogleMeetButton from './components/GoogleMeetButton';
import MeetingScreen from './pages/meetings/meeting_screen';
import MinuteNoteEdit from './pages/meetings/minute_note_edit';
import MinuteCreate from './pages/meetings/minute_create';
import MinuteNoteDetail from './pages/meetings/minute_note_detail';
import AttendanceForm from './pages/attendance/attendance_form';
import AttendanceList from './pages/attendance/attendance_list';
import AttendanceDetails from './pages/attendance/attendance_details';

function Sidebar() {
  const navigate = useNavigate();

  return (
    <div style={{ display: 'flex' }}>
  {/* Sidebar */}
  <div style={{
    width: '200px',
    padding: '20px',
    backgroundColor: '#add8f7', // light blue
    height: '100vh',
    position: 'fixed',
    top: 0,
    left: 0,
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    gap: '40px'
  }}>
    <button
      onClick={() => navigate('/')}
      style={{
        backgroundColor: 'white',
        color: 'black',
        border: 'none',
        borderRadius: '25px',
        padding: '15px 20px',
        width: '100%',
        fontSize: '1rem',
        cursor: 'pointer'
      }}
    >
      Google Meet
    </button>

    <button
      onClick={() => navigate('/meeting_screen')}
      style={{
        backgroundColor: 'white',
        color: 'black',
        border: 'none',
        borderRadius: '25px',
        padding: '15px 20px',
        width: '100%',
        fontSize: '1rem',
        cursor: 'pointer'
      }}
    >
      Meeting Notes
    </button>

    <button
      onClick={() => navigate('/attendance')}
      style={{
        backgroundColor: 'white',
        color: 'black',
        border: 'none',
        borderRadius: '25px',
        padding: '15px 20px',
        width: '100%',
        fontSize: '1rem',
        cursor: 'pointer'
      }}
    >
      Attendance
    </button>
  </div>

  {/* Main content */}
  <div style={{ marginLeft: '200px', padding: '20px', width: '100%' }}>
    <h1>Meeting Notes</h1>
    <button
      onClick={() => navigate('/minute_create')}
      style={{
        backgroundColor: '#add8f7',
        border: 'none',
        borderRadius: '25px',
        padding: '10px 20px',
        fontSize: '1rem',
        marginBottom: '20px',
        cursor: 'pointer'
      }}
    >
      Create New Minute Note
    </button>

    {meetingNotes.length === 0 ? (
      <p>No meeting notes found.</p>
    ) : (
      <ul style={{ listStyle: 'none', padding: 0 }}>
        {meetingNotes.map(note => (
          <li
            key={note._id}
            onClick={() => handleNoteClick(note._id)}
            style={{
              marginBottom: '1em',
              cursor: 'pointer',
              border: '1px solid gray',
              borderRadius: '15px',
              backgroundColor: '#d9ecfd',
              padding: '15px',
              width: 'fit-content',
              fontSize: '1rem',
              fontStyle: 'italic'
            }}
          >
            <div><strong>Title:</strong> <span style={{ fontStyle: 'italic' }}>{note.title}</span></div>
            <div><strong>Content:</strong> <span style={{ fontStyle: 'italic' }}>{note.content.slice(0, 100)}...</span></div>
            <div><strong>Created:</strong> <span style={{ fontStyle: 'italic' }}>{formatDate(note.createdAt)}</span></div>

            <div style={{ marginTop: '10px', display: 'flex', gap: '10px' }}>
              <button
                onClick={(e) => { e.stopPropagation(); navigate(`/minute_note_detail/${note._id}`); }}
                style={{
                  backgroundColor: '#d3d3d3',
                  border: 'none',
                  borderRadius: '15px',
                  padding: '5px 10px',
                  cursor: 'pointer'
                }}
              >
                Edit
              </button>
              <button
                onClick={(e) => handleDelete(e, note._id)}
                style={{
                  backgroundColor: '#ff6b6b',
                  color: 'white',
                  border: 'none',
                  borderRadius: '15px',
                  padding: '5px 10px',
                  cursor: 'pointer'
                }}
              >
                Delete
              </button>
            </div>
          </li>
        ))}
      </ul>
    )}
  </div>
</div>

  );
}

function HomePage() {
  return (
    <div>
      <h2>Google Meet</h2>
      <GoogleMeetButton />
    </div>
  );
}

function App() {
  return (
    <div style={{ display: 'flex' }}>
      <Sidebar />
      <div style={{ flex: 1, padding: '20px' }}>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/meeting_screen" element={<MeetingScreen />} />
          <Route path="/minute_note_detail/:id" element={<MinuteNoteDetail />} />
          <Route path="/minute_note_edit/:id" element={<MinuteNoteEdit />} />
          <Route path="/minute_create" element={<MinuteCreate />} />
          <Route path="/attendance" element={<AttendanceList />} />
          <Route path="/attendance/details/:id" element={<AttendanceDetails />} />
          <Route path="/attendance/add" element={<AttendanceForm />} />
          <Route path="/attendance/create" element={<AttendanceForm />} />
          <Route path="/attendance/list" element={<AttendanceList />} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
